'''''winyamo''''' is a [[Quenya]] word meaning "youngster".<ref name=VT47>{{VT|47a}}, p. 26</ref>

== Etymology ==
[[Patrick H. Wynne]] has suggested that the word consists of ''[[vinya|winya]]'' ("young") + ''[[mo]]'' ("somebody, one").<ref name=VT47/>

